import React, { useState } from 'react'
import './Singup.scss'

export default function Singup() {
  const [fullname,setFullname] = useState('')
  submit= async(e)=>{
    e.preventDefault()
    try{
      await axios.post("htt://",{
        fullname 
      })      
    }catch(e){
      console.log(e)
    }
  }
  return (
    <>
    <div className="container-fluid" id='singup-form'>
        <div className="container">
          <div class="login-page">
            <div class="form">
              <form class="login-form" action='POST'>
                <input type="text" placeholder="fullname" name="fullname" onChange={(e)=>{setFullname(e.target.value)}}/>
                <input type="password" placeholder="password" />
                <input type="text" placeholder="email address" />
                <button className='btn-info' value="submit" type='submit'>create</button>
                <p class="message">
                  Already registered? <a href="/login" className='text-info'>Sign In</a>
                </p>
              </form>
            </div>
          </div>
        </div>
      </div>
    </>
  )
}
